package non_static;

public class swapno2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=20;
		int c;
	
		
		c=a;
		a=b;
		b=c;
		
		System.out.println("After swapping"+" "+a);
		System.out.println("After Swapping"+" "+b);

	}

}
